// styles
import "./styles.scss";



const SingleSite = () => {
  return (
    <div className="single-site">
      <ul className="singleSite-list">
        {sites.map(site => {
          return (
            <li>
              <a href={site.url} target="_blank" className="singleSite-link">
                {site.name}
              </a>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default SingleSite;
